-family:=\"\" \"times=\"\" roman\"\"=\"\">&nbsp;</span><img src=\"data:image/jpeg;base64,\" data-filename=\"service.jpeg\" style=\"width: 500px;\"></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\"><!--[if gte vml 1]><v:shape id=\"_x0000_i1027\" type=\"#_x0000_t75\"\r\n style=\'width:450pt;height:450pt\'>\r\n <v:imagedata src=\"file:///C:\\Users\\SBIT\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image005.jpg\"\r\n  o:title=\"4cd5dc64d0df06d74cd5dc64d0df06d77566\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">Copy Center</span></b><span style=\"font-size:12.0pt;\r\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">:\r\nCopy centers offer customers a range of solutions, including copying, scanning,\r\nand printing services. These centers are ideal for businesses that need to copy\r\nlarge quantities of documents.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">Quick Print Scan Photocopy Fax Services</span></b><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">: Quick Print Scan Photocopy Fax Services offer customers\r\nfast and efficient copying and scanning solutions. This service is ideal for\r\nthose who need to copy or scan documents on a tight schedule.</s