INSERT INTO `service_infos` (`id`, `index_no`, `service_name`, `service_name_italic`, `description`, `description_italic`, `image`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Airport Shuttle/Transfer', 'Navetta Aeroportuale', '<p class=\"MsoNormal\"><span lang=\"EN-GB\">ROME\r\nAIRPORT SHUTTLE <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">ROME\r\nAIRPORT SHUTTLE is a brand of Vatican Multiservice Travel &amp; Tours founded\r\nin 2009, aimed at offering ground transportation services. We started in Rome and\r\nhave since continued growing to deliver European wide services and transporting\r\nseveral millions of passengers. See our more Services: </span><a href=\"http://www.vaticanmultiservice.site/service\"><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:\" arial\",\"sans-serif\"\"=\"\">http://www.vaticanmultiservice.site/service</span></a><span style=\"font-size:10.0pt;line-height:115%;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Our aim is\r\nto provide great value quality services helping travellers find and book the\r\nperfect trip.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-ansi-language:en-gb\"=\"\">We provide Top\r\nQuality services at affordable prices!Rome Airport Shuttles offers private and\r\nshared shuttle car services to and from Civitavecchia cruise port, airports, train\r\nstations, hotels in Rome and all over Italy.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-ansi-language:en-gb\"=\"\">We provide also\r\nspecial services with English speaking knowledgeable drivers for city tours.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-ansi-language:en-gb\"=\"\">All our qualified\r\ndrivers have the proper license for all services; they also have a special\r\npermit to pick up/drop off you directly beside the cruise line by Civitavecchia\r\nport.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-ansi-language:en-gb\"=\"\">Our Private and\r\nShared Shuttle ride is considered the best service in Rome at reasonable price.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-ansi-language:en-gb\"=\"\">You Can&nbsp; Visit Our Website For details: </span><a href=\"http://www.vaticanmultiservice.site/about_faq\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;font-family:\" arial\",\"sans-serif\";=\"\" mso-ansi-language:en-gb\"=\"\">http://www.vaticanmultiservice.site/about_faq</span></a><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;font-family:\" arial\",\"sans-serif\";=\"\" mso-ansi-language:en-gb\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><u><span lang=\"EN-GB\">Door to\r\nDoor Services</span></u><span lang=\"EN-GB\">: We\r\nwill pick you up and drop you off directly at your destination<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><u><span lang=\"EN-GB\">Plan\r\nYour Transfers</span></u><span lang=\"EN-GB\">:\r\nPrivate or shared transfers available to suit your group size and budget.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><u><span lang=\"EN-GB\">24 hours\r\na day 7 days a week</span></u><span lang=\"EN-GB\">:\r\nWherever at any time you require collecting from, we are always on service.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><u><span lang=\"EN-GB\">Fully\r\nLicensed Vehicles</span></u><span lang=\"EN-GB\">:\r\nAll our vehicles are fully licensed with air-condition and maximum insurance\r\npolicy.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><u><span lang=\"EN-GB\">Airport Shared Shuttle: FROM 40€ FOR 2\r\nPASSENGERS<o:p></o:p></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Ride with others travellers in the same direction.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Door to Door/Meet &amp; Greet.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Max Waiting 1hour after landing time.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><u><span lang=\"EN-GB\">Fiumicino Airport to Rome City Airport Private\r\nTransfer:<o:p></o:p></span></u></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">FROM 55€\r\nFOR 2 PASSENGERS<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Ride on your own.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Meet &amp; Greet.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family:\" ms=\"\" gothic\";mso-bidi-font-family:=\"\" \"ms=\"\" gothic\";mso-ansi-language:en-gb\"=\"\">✔</span><span lang=\"EN-GB\"> Max Waiting 1hour after landing time.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"EN-GB\">Rome City to Fiumicino Airport Transfer<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">FROM 55€\r\nFOR 2 PASSENGERS<o:p></o:p></span