t-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-GB\">Rome\r\nHighlights - Private shore excursion<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:72.0pt;mso-add-space:\r\nauto;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:EN-GB\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-GB\">Florence\r\n- Private tour<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:72.0pt;mso-add-space:\r\nauto;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:EN-GB\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-GB\">Venice\r\n- Private tour<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:72.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-ansi-language:EN-GB\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-GB\">Naples\r\n- Private tour<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin: 0cm 6.65pt 13.35pt; text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><u><span lang=\"EN-GB\" style=\"font-size:30.0pt;\r\nfont-family:Roboto;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" \"times=\"\" roman\";color:#555555;mso-ansi-language:en-gb;mso-fareast-language:=\"\" it\"=\"\">Contact Us</span></u></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; \"><b><span lang=\"EN-GB\">Airport Transfer &nbsp;by Vatican Multiservice Point<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Via Ostia 4&nbsp;&nbsp; 00192\r\nRome (In front of Vatican Museum-Metro Ottaviano)</p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-GB\">Why Waiting?\r\nBook Now!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-GB\">Cell: 0039\r\n389 4707089 (WhatsApp)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-GB\">Email: </span><a href=\"mailto:vaticanmultiservicepoint@gmail.com\"><span lang=\"EN-GB\">vaticanmultiservicepoint@gmail.com</span></a><span lang=\"EN-GB\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span lang=\"EN-GB\">Booking:See\r\nMap Direction: &nbsp;</span><a href=\"https://goo.gl/maps/fPHRH8PRVPe9cKYs5\"><span lang=\"EN-GB\">https://goo.gl/maps/fPHRH8PRVPe9cKYs5</span></a><span lang=\"EN-GB\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>', '<p class=\"MsoNoSpacing\">NAVETTA AEROPORTO DI ROMA</p>\r\n\r\n<p class=\"MsoNoSpacing\">ROME AIRPORT SHUTTLE è un brand di Vatican Multiservice\r\nTravel &amp; Tours fondato nel 2009, volto ad offrire servizi di trasporto via\r\nterra. Abbiamo iniziato a Roma e da allora abbiamo continuato a crescere per\r\nfornire servizi a livello europeo e trasportare diversi milioni di passeggeri.\r\nVedere i nostri più Servizi: http://www.vaticanmultiservice.site/service</p>\r\n\r\n<p class=\"MsoNoSpacing\">Il nostro obiettivo è fornire servizi di qualità di\r\ngrande valore aiutando i viaggiatori a trovare e prenotare il viaggio perfetto.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Offriamo servizi di alta qualità a prezzi\r\nconvenienti!Rome Airport Shuttles offre servizi di auto navetta private e\r\ncondivise da e per il porto crocieristico di Civitavecchia, aeroporti, stazioni\r\nferroviarie, hotel a Roma e in tutta Italia.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Forniamo anche servizi speciali con autisti esperti di\r\nlingua inglese per tour della città.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Tutti i nostri autisti qualificati hanno la licenza\r\nadeguata per tutti i servizi; hanno anche un permesso speciale per prenderti /\r\nlasciarti direttamente accanto alla compagnia di crociera al porto di\r\nCivitavecchia.</p>\r\n\r\n<p class=\"MsoNoSpacing\">La nostra corsa in navetta privata e condivisa è\r\nconsiderata il miglior servizio a Roma a un prezzo ragionevole.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Puoi visitare il nostro sito Web per i dettagli:\r\nhttp://www.vaticanmultiservice.site/about_faq</p>\r\n\r\n<p class=\"MsoNoSpacing\">Servizi porta a porta: verremo a prendervi e vi lasceremo\r\ndirettamente a destinazione</p>\r\n\r\n<p class=\"MsoNoSpacing\">Pianifica i tuoi trasferimenti: trasferimenti privati ​​o\r\ncondivisi disponibili per soddisfare le dimensioni e il budget del tuo gruppo.</p>\r\n\r\n<p class=\"MsoNoSpacing\">24 ore al giorno 7 giorni alla settimana: Ovunque e in qualsiasi\r\nmomento richieda il ritiro, siamo sempre in servizio.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Veicoli con licenza completa: tutti i nostri veicoli sono\r\ndotati di licenza completa con aria condizionata e polizza assicurativa\r\nmassima. Navetta condivisa aeroportuale: DA 40€ PER 2 PASSEGGERI</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Pedala con altri viaggiatori nella\r\nstessa direzione.</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Porta a porta/Meet &amp; Greet.</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Attesa massima 1 ora dopo l\'orario\r\ndi atterraggio.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Trasferimento privato dall\'aeroporto di Fiumicino\r\nall\'aeroporto di Roma:</p>\r\n\r\n<p class=\"MsoNoSpacing\">DA 55€ PER 2 PASSEGGERI</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Pedala da solo.</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Incontra e saluta.</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-US\" style=\"font-family:&quot;MS Gothic&quot;;\r\nmso-bidi-font-family:&quot;MS Gothic&quot;\">✔</span> Attesa massima 1 ora dopo l\'orario\r\ndi atterraggio.</p>\r\n\r\n<p class=\"MsoNoSpacing\">Trasferimento dall