(6, 5, 'Rome Metro Bus Tickets', 'Rome Metro Bus Tickets', '<p class=\"MsoNormal\"><span lang=\"EN-GB\">Welcome to\r\nRome, Italy! If you\'re planning to explore the city, you\'re in luck. Rome\'s\r\nexcellent public transportation system includes metros, buses, and trams. And to\r\nmake your journey even more enjoyable, we\'ve got Rome Metro Bus Tram Tickets\r\nfor you!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">With our\r\ntickets, you can easily hop on and off any public transportation in Rome. You\r\ncan purchase them at any metro station or in one of our three authorized\r\noffices in Rome city center. And don\'t worry. Our friendly team is always there\r\nto assist you with using the tickets and answer any questions.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">The public\r\ntransportation system in Rome, Italy, includes metro, bus, and tram services.\r\nTo use these services, you will need to purchase a ticket. Here\'s some\r\ninformation about tickets:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">.Tickets\r\ncan be purchased at any metro station; our 3 official offices in Rome center\r\nVia Ostia 4 00192 Rome, Via Germanico 43 00192 Rome, and Via Ulpiano 43 00193\r\nRome, all are near Vatican Museum. Our team assists you with how you can use\r\nthese tickets.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">.Tickets\r\nare valid for 100 minutes from the validation time and can be used on multiple\r\nbuses, trams, and metro lines within that time frame.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">Different\r\ntypes of tickets are available, including single tickets, daily tickets, and\r\nweekly tickets. Discounted tickets are also available for children, seniors,\r\nand people with disabilities.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">.When you\r\nboard a bus or tram, you must validate your ticket using the machines on board\r\nor at the metro station entrance. Failure to do so can result in a fine.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">.When using\r\nthe metro, you must also validate your ticket by inserting it into the\r\nturnstile at the entrance to the metro platform.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">.Keep your\r\nticket with you during your journey, as inspectors may ask to see it at any\r\npoint.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">It\'s\r\nimportant to note that Rome also offers a Roma Pass for tourists, which\r\nincludes free entry to two museums or archaeological sites, discounts on other\r\nmuseums and exhibitions, and unlimited use of public transport for three days.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-ansi-language:EN-GB;mso-fareast-language:IT\">Contact Us<o:p></o:p></span></u></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-fareast-language:IT;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeigh