r\n&quot;Arial&quot;,&quot;sans-serif&quot;\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">Why Waiting? Contact\r\nNow!!<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">Cell: 0039 351 149\r\n6463 (WhatsApp)<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">Email:\r\nvaticanmultiservicepoint@gmail.com<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:EN-GB\">See Map\r\nDirection:&nbsp;\r\nhttps://goo.gl/maps/fPHRH8PRVPe9cKYs5</span></b><span lang=\"EN-GB\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nEN-GB