(7, 6, 'MoneyGram Rome', 'MoneyGram Rome', '<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">Welcome\r\nto the Rome branch of the MoneyGram cash-transfer service. We offer clients the\r\nopportunity to send and receive money worldwide from our three locations. Our\r\nrates are competitive, and our low commission makes us ideal for clients\r\nlooking to send money from Italy, Europe or rest of the world. We are also\r\nproud to provide our clients with an additional security for payments, in the\r\nform of a Money gram authorization code. This allows you to control the amount\r\nof money sent, and to monitor its progress.</span></p>\r\n\r\n<p class=\"MsoNoSpacing\">MoneyGram Rome Have 3 Locations Rome Center one is in Via\r\nOstia 4 00192 Rome, Via Ulpiano 43 00193 Rome, Via Germanico 43 00192 Rome. <span lang=\"EN-GB\">All locations can find easily from\r\nGoogle Maps and direction, MoneyGram Store is in Rome Center Prati area and\r\nvery closes from Vatican museum. We offer clients to send and receive money\r\nworldwide from our top location. We provide the best rate and low commission\r\nfor the clients. You are welcome to our store.</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">We offer\r\nclients the opportunity to send and receive money worldwide from our top\r\nlocation. We provide competitive rates and low commission, making us ideal for\r\nclients looking to send money from Italy, Europe or beyond. In addition to our\r\ntop-notch rates and low commission,</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">What are\r\nMoneyGram\'s Rome store locations?<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\"> </span>3 Locations Rome Center one is in Via Ostia 4 00192 Rome,\r\nVia Ulpiano 43 00193 Rome, Via Germanico 43 00192 Rome,</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">MoneyGram\r\nhas 186,000 branches worldwide and has been present in Italy since 1996. It has\r\nan extensive branch network and a large retail partnership with local agency in\r\nRome City Center.</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">What is\r\nMoneyGram\'s Rome store hours?</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">Our\r\nLocations are open Every day 9:00 am to 19:00 and Sunday 10:00 to 18:00</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">The\r\nVatican Multiservice Point is a MoneyGram store located in the center of Rome,\r\nnear the Vatican Museum. We offer our clients the ability to send and pick up\r\nmoney in 10 minutes or less worldwide. We also offer a variety of other\r\nservices such as currency exchange and money transfers.</span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span lang=\"EN-GB\">The\r\nVatican Multiservice Point is a convenient way to send and receive money\r\nworldwide. Our 10-minute pickup services was available in any destination,\r\nmaking us the perfect choice for those who need fast and reliable service. We\r\nare located near the Vatican Museum in Rome, making us easily accessible for\r\nour clients. Whether you\'re sending or cashing money, we offer a hassle-free\r\nexperience that can\'t be beat.<o:p></o:p></span></p>', NULL, '622908590.jpg', 1, NULL, '2023-03-08 17:31:10');
