(8, 7, 'Ria Money Transfer & Change', NULL, '<p class=\"MsoNormal\"><span lang=\"EN-GB\">At Ria\r\nMoney Transfer &amp; Change Rome, we provide our customers with the highest\r\nquality money services. With multiple locations across Rome Center and Prati,\r\nRia Money Transfer &amp; Change Rome is here to make international money\r\ntransfers simple and easy. We offer unbeatable rates and low commission fees\r\nfor international money transfers. Whether you need to send or receive money\r\nworldwide, trust us to provide fast, honest, and reliable assistance. Visit us\r\nat any of our convenient locations today and experience the Ria Money Transfer\r\n&amp; Change Rome difference!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;So you can save money while ensuring your\r\nfunds are securely sent and received. Our dedicated professionals will guide\r\nyou through every step of the process to ensure your transaction goes smoothly.\r\nRia Money Transfer and Change has everything you need to send money overseas,\r\nto friends or family, or just for fun. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\">So visit us\r\ntoday at any of our three locations - Via Ostia 4 00192, Via Ulpiano 43 00193,\r\nor Via Germanico 43 00192 in Roma - for all your global transfer needs!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nEN-GB\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-ansi-language:EN-GB;mso-fareast-language:IT\">Contact Us<o:p></o:p></span></u></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" align=\"center\" style=\"text-ali