(13, 10, 'DHL Express Shipping Rome', 'DHL Express Shipping Rome', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#0E101A;mso-ansi-language:EN-GB;\r\nmso-fareast-language:IT\">Welcome to DHL Express Shipping Rome, your go-to\r\ncourier service for express delivery across Europe. We know how important it is\r\nto deliver your packages on time, so we offer guaranteed delivery within the\r\nnext business day. With three convenient locations in the heart of Rome - Via\r\nOstia 4 00192, Via Germanico 43 00912, and Via Ulpiano 43 00193 - you\'ll never\r\nhave to worry about finding us.<o:p></o:p></span></p><ul style=\"margin-top:0cm\" type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"color:#0E101A;margin-bottom:0cm;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-GB;\r\n     mso-fareast-language:IT\">Affordable delivery - Reliable couriers, quick\r\n     response time, and global reach.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#0E101A;margin-bottom:0cm;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-GB;\r\n     mso-fareast-language:IT\">Over 3,000 Access Points. International &amp;\r\n     Domestic.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#0E101A;margin-bottom:0cm;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:li