(14, 11, 'UPS Express Shipping Rome', 'UPS Express Shipping Rome', '<p class=\"MsoNormal\"><span lang=\"EN-GB\">Were you\r\nlooking for a reliable courier service that delivers your packages fast and on\r\ntime? Look no further than UPS Express Shipping Rome! Our express delivery\r\nservice covers Europe and is designed to get your parcels to their destination\r\nwithin the next business day. With three convenient locations in the heart of\r\nRome, finding us is easy and hassle-free. With three convenient locations in\r\nthe heart of Rome - Via Ostia 4 00192 Rome, Via Germanico 43 00192, and Via\r\nUlpiano 43 00193 Rome - you\'ll never have to worry about finding us. Whether\r\nyou\'re sending important documents or precious gifts to loved ones, we\r\nunderstand how important it is to get them there safely and on time. So why\r\nwait? Choose UPS Express Shipping Rome for all your express shipping needs and\r\nexperience the fast, friendly service you can count on!<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Choose from three convenient locations\r\nin Rome.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Affordable prices and guaranteed\r\ndelivery on time.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Instant delivery is available in most\r\nEuropean countries.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Track your package with progress\r\nupdates from our team of couriers.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; One-hour delivery time to any\r\ndestination in Europe.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Three convenient locations in Rome.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Affordable delivery costs<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">UPS Express\r\nShipping Rome is your one-stop shop for reliable, fast, secure express delivery\r\nservices across Europe. With three convenient locations in the heart of Rome,\r\nyou can count on us to deliver your packages quickly and safely – consistently\r\nwithin the next business day.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">We\'ve\r\nprovided professional courier services with expert customer service since 1995.\r\nAt UPS Express Shipping Rome, we work hard daily to ensure your packages are\r\ndelivered on time and arrive safely and sound. You can trust us to provide\r\nindustry-leading services every single time consistently.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">With\r\ndecades of experience delivering packages to every corner of the globe, UPS\r\nExpress Shipping Rome is your go-to team for reliable courier services. Whether\r\nyou\'re shipping a small container or a whole pallet, our range of professional\r\nservices makes sure that your items arrive on time and exactly where they need\r\nto be – every time.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">Our\r\nall-inclusive approach ranges from efficient tracking systems so you can keep\r\nan eye on your shipment\'s progress packaging expertise for fragile items, and\r\nmore – all at competitive prices. Our easy-to-use shipping solutions help you\r\nsave time, money, and hassle.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">With UPS\r\nExpress Shipping Rome, you can expect guaranteed delivery within the next\r\nbusiness day, making us your go-to partner for urgent shipments. We understand\r\nthe importance of timely delivery, so we offer a range of support services to\r\nensure your packages arrive safely and on time.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\">Our\r\ntracking systems allow you to know the exact location of your shipment at any\r\ngiven point while our technology helps you manage regular shipments\r\nefficiently. Our packaging expertise ensures that fragile items arrive\r\nundamaged,<o:p></o:p></span></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-ansi-language:EN-GB;mso-fareast-language:IT\">Contact Us<o:p></o:p></span></u></b></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-fareast-language:IT;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_1\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\r\n style=\'width:25.5pt;height:21pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:ima