(15, 11, 'Fedex Express Rome Shipping', 'Fedex Express Rome Shipping', '<p class=\"MsoNormal\"><span lang=\"EN-GB\">Fedex\r\nExpress Rome Shipping<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">Were you looking for a\r\nreliable courier service that can deliver your packages across Europe in no time?\r\nLook no further than FedEx Express Rome Shipping! With our commitment to speedy\r\ndelivery and guaranteed next-day service, you can trust that your packages will\r\nalways arrive on time and in perfect condition.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">FedEx Express offers shipping\r\nservices in Rome, including international and domestic express shipping,\r\ncourier, and delivery services. Depending on their needs, customers can choose\r\nfrom various shipping options, including same-day, next-day, and two-day\r\nshipping.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">FedEx Express also provides\r\npackage tracking and delivery confirmation services, allowing customers to\r\ntrack the progress of their shipment from pickup to delivery. Additionally,\r\nFedEx offers a range of packaging options, including boxes, envelopes, and\r\ntubes, to help ensure that shipments are packed securely and safely.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">Delivery from FedEx Express\r\nRome is a breeze. We offer express delivery across the continent. We use a\r\nnetwork of dedicated couriers to ensure your package has quick, reliable\r\nservice anywhere in Europe. Your package will be delivered on time and without\r\nhassle, so trying us out today is worth it.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">Fedex Express Rome Shipping\r\noffers quick, reliable delivery of your packages and has three convenient\r\nlocations in the heart of Rome. We guarantee immediate dispatch within one\r\nbusiness day and offer a 100% customer satisfaction program.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">Our experienced team of\r\ncouriers is dedicated to providing the best possible service to each one of our\r\ncustomers. Whether you\'re shipping a small package or a large one, we\'ll ensure\r\nit arrives at its destination the same day it leaves your hands. And with three\r\nconvenient locations in the heart of Rome, you\'ll never have to go far to find\r\nus!<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">So why wait? Choose FedEx\r\nExpress Rome Shipping for all your courier service needs and experience. With\r\nthree convenient locations in the heart of Rome - Via Ostia 4 00192, Via\r\nGermanico 43 00912, and Via Ulpiano 43 00193 - you\'ll never have to worry about\r\nfinding us.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-GB;mso-fareast-language:IT\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0E101A;mso-ansi-language:EN-GB;mso-fareast-language:IT\">&nbsp;</span></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span lang=\"EN-GB\" style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-ansi-language:EN-GB;mso-fareast-language:IT\">Contact Us<o:p></o:p></span></u></b></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><b><u><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#555555;mso-fareast-language:IT;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\