INSERT INTO `service_infos` (`id`, `index_no`, `service_name`, `service_name_italic`, `description`, `description_italic`, `image`, `status`, `created_at`, `updated_at`) VALUES
(21, 14, 'Copy Print Scan Fax Plastification', 'Copia Stampa Scansione Fax Plastificazione', '<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">Print Service\r\nprovides fast and affordable printing and copying services for your business.\r\nWe offer Internet Point, Copy Service, Page Service and Internet Cafe services\r\nto help you get your print jobs done quickly and efficiently. Our team of\r\nexperienced professionals is passionate about providing top-quality printing\r\nand copying services to our clients in a friendly and professional atmosphere.\r\nWe also offer Fax Plasticisation for your extra sensitive documents.</span><o:p></o:p></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">Print Service offers\r\nfast, affordable and high-quality printing solutions tailored to meet your\r\nbusiness\'s needs. Our team of experienced professionals is passionate about\r\nproviding top-quality printing services to our clients in a friendly and\r\nprofessional atmosphere. From Copy Service, Page Service and Internet Cafe\r\nServices to Fax Plasticisation for your extra sensitive documents, we have a\r\nservice for you.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">Do you need printing\r\nor copying services for your business? Look no further than Print Service,\r\nwhere our experienced and passionate team can help you get your print jobs done\r\nquickly and professionally. We offer Internet Point, Copy Service, Page Service\r\nand Internet Cafe services to help you get your print jobs done quickly and\r\nefficiently. Our team of experienced professionals is passionate about\r\nproviding top-quality printing and copying services so that your company can\r\nrun smoothly. You can visit our website <a href=\"https://www.vaticanmultiservice.site/serviceDetail/11\">https://www.vaticanmultiservice.site/serviceDetail/11</a>\r\n&nbsp;for more information about our business\r\nprinting services!<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">At Print Service,\r\nwe\'re proud of our team of experienced professionals. We have a passion for\r\nproviding top-quality printing and copying services to our clients in a\r\nfriendly and professional atmosphere. We also offer Fax Plasticisation for your\r\nextra sensitive documents. <u>Contact us today at 0039 351 149 6463</u>.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">Print Service\r\ndelivers high-quality, professional copies and fast. We achieve this through\r\nour vast experience in print and copying services, our reliable equipment, and\r\nby providing top-quality customer service that is second to none.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Roboto;color:#354254;mso-ansi-language:EN-GB\">&nbsp;</span></p>', '<p class=\"MsoNormal\">Print Service offre servizi di stampa e copia rapidi e\r\nconvenienti per la tua azienda. Offriamo servizi di Internet Point, Copy\r\nService, Page Service e Internet Cafe per aiutarti a svolgere i tuoi lavori di\r\nstampa in modo rapido ed efficiente. Il nostro team di professionisti esperti è\r\nappassionato di fornire servizi di stampa e copia di alta qualità ai nostri\r\nclienti in un\'atmosfera amichevole e professionale. Offriamo anche la\r\nplastificazione fax per i tuoi documenti più sensibili.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Print Service offre soluzioni di stampa rapide, convenienti\r\ne di alta qualità su misura per soddisfare le esigenze della tua azienda. Il\r\nnostro team di professionisti esperti è appassionato di fornire servizi di\r\nstampa di alta qualità ai nostri clienti in un\'atmosfera amichevole e\r\nprofessionale. Dal servizio di copia, servizio di pagina e servizi di Internet\r\nCafe alla plastificazione fax per i tuoi documenti più sensibili, abbiamo un\r\nservizio per te.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Hai bisogno di servizi di stampa o fotocopiatura per la tua\r\nattività? Non guardare oltre Print Service, dove il nostro team esperto e\r\nappassionato può aiutarti a portare a termine i tuoi lavori di stampa in modo\r\nrapido e professionale. Offriamo servizi di Internet Point, Copy Service, Page\r\nService e Internet Cafe per aiutarti a svolgere i tuoi lavori di stampa in modo\r\nrapido ed efficiente. Il nostro team di professionisti esperti è appassionato\r\ndi fornire servizi di stampa e copia di alta qualità in modo che la tua azienda\r\npossa funzionare senza problemi. Puoi visitare il nostro sito web https://www.vaticanmultiservice.site/serviceDetail/11&nbsp; per maggiori informazioni sui nostri servizi di stampa aziendale!<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">In Print Service, siamo orgogliosi del nostro team di\r\nprofessionisti esperti. Abbiamo una passione per fornire servizi di stampa e\r\ncopia di alta qualità ai nostri clienti in un\'atmosfera amichevole e\r\nprofessionale. Offriamo anche la plastificazione fax per i tuoi documenti più\r\nsensibili. Contattaci oggi allo<b><u> 0039 351 149 6463.</u></b><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\">Print Service offre copie di alta qualità, professionali e\r\nveloci. Raggiungiamo questo obiettivo grazie alla nostra vasta esperienza nei\r\nservizi di stampa e copia, alle nostre attrezzature affidabili e fornendo un\r\nservizio clienti di alta qualità che non è secondo a nessuno.</p>', '1576994853.jpg', 1, NULL, '2023-03-04 21:33:02'),
