(36, 26, 'Vatican Museum Tickets & Tours', 'Vatican Museum Tickets & Tours', '<p><span lang=\"EN-GB\">Vatican City, a UNESCO\r\nWorld Heritage Site and one of the most iconic places on Earth, is waiting to\r\nbe explored! Vatican Museum Tickets &amp; Tours makes it easy to do so with our\r\nguided tours of all its most important treasures. From the Vatican Museums and\r\nSistine Chapel to St. Peter\'s Square, you won\'t miss anything with our\r\nknowledgeable guides leading the way.<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Take a guided tour of the Vatican\'s\r\ngreatest treasures.<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Discover the Vatican Museums, St. Peter\r\nsquare, and more on our guided tours.<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Avoid long lines and purchase\r\nfast-track tickets online to skip the line.<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Book your tickets with ease from our\r\nlocation in Via Ostia 4 00192 Rome, Italy<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Experience Vatican City for yourself.\r\nWe are the official tour company to Vatican Museums, Sistine Chapel, St. Peter\r\nSquare, and more.<o:p></o:p></span></p><p><span lang=\"EN-GB\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Skip the line with our fast-track\r\ntickets, and get your tickets from our location near the Metro stop of Via\r\nOstia 4 in Rome.<o:p></o:p></span></p><p><span lang=\"EN-GB\">We offer various tours to\r\nsuit every schedule and interest, including our famous Vatican at Night and\r\nEarly Entrance tours. With our fast-track, skip-the-line tickets, you\'ll avoid\r\nthe hassle of long lines and crowds, ensuring you make the most of your time in\r\nVatican City.<o:p></o:p></span></p><p><span lang=\"EN-GB\">Our friendly team is at Via\r\nOstia 4&nbsp; 00192 Rome( Near Vatican Museum\r\n). See google maps directions: &nbsp;&nbsp;https://goo.gl/maps/cE3pmVE9Y4RRM66P7<o:p></o:p></span></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><span lang=\"EN-GB\" style=\"font-size:9.0pt;mso-ansi-language:EN-GB;mso-fareast-language:IT\">Contact\r\nUs<o:p></o:p></span></p><p class=\"MsoNoSpacing\" align=\"center\" style=\"text-align:center\"><span style=\"font-size:9.0pt;mso-fareast-language:IT;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_1\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\r\n style=\'width:25.5pt;height:21pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:\\Users\\LASERP~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\"\r\n  o:title=\"download (4)\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><img width=\"34\" height=\"28\" src=\"file:///C:/Users/LASERP~1/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg\" v:shapes=\"Picture_x0020_1\"><!--[endif]--></span><span lang=\"EN-GB\" style=\"font-size:\r\n9.0pt;mso-ansi-language:EN-GB;mso-fareast-language:IT\"><o:p></o:p></span></p><p class=\"Ms