(42, 23, 'FlixBus Ticket  Office Rome', 'FlixBus Tickets', '<p>Green, smart mobility from FlixBus and FlixTrain<br></p><p><span style=\"font-size: 14px;\">Are you looking for an eco-friendly and affordable way to travel around Italy and Europe? Look no further than FlixBus! Our mission is to make sustainable mobility accessible to everyone, and we do that by offering comfortable, safe, and environmentally-friendly options for long-distance travel.</span></p><p><span style=\"font-size: 14px;\">We are proud to provide millions of passengers with an innovative, sustainable, and comfortable experience that meets the highest safety and environmental protection standards. Furthermore, with our selection of last-minute tickets and unbeatable prices, we make green mobility accessible to everyone who wants to explore the world.</span></p><p><span style=\"font-size: 14px;\">·&nbsp; &nbsp; &nbsp; &nbsp; Rome is the biggest city in Italy and is a must-visit destination.</span></p><p><span style=\"font-size: 14px;\">·&nbsp; &nbsp; &nbsp; &nbsp; The bus network is excellent, with more routes than any other European city.</span></p><p><span style=\"font-size: 14px;\">·&nbsp; &nbsp; &nbsp; &nbsp; Cheap tickets make this an affordable way to travel throughout Italy.</span></p><p><span style=\"font-size: 14px;\">·&nbsp; &nbsp; &nbsp; &nbsp; Offers eco-friendly travel options, no matter what person you are.</span></p><p><span style=\"font-size: 14px;\">Rome FlixBus Ticket Office offers an excellent way to travel Italy and Europe – conveniently, sustainably, and affordably. Strategically located in Via Ostia 4 00192, Via Germanico 43 00912, and Via Ulpiano 43 00193 Rome, our three locations make it easy for travelers to secure tickets for their next journey.</span></p>', NULL, '142488403.jpg', 1, NULL, '2023-03-11 21:39:06'),
