INSERT INTO `testimonials` (`id`, `index_no`, `description`, `description_italic`, `client_name`, `designation`, `image`, `status`, `ratings`, `created_at`, `updated_at`) VALUES
(1, 101, '<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-family:\"Arial\",\"sans-serif\";\r\nmso-ansi-language:EN-GB\">Nice and friendly staff, print and cut quickly and\r\nwithout any problems!<o:p></o:p></span></p>', '<p class=\"MsoNormal\">Perso﻿nale gentile e cordiale, stampa e taglio rapido e\r\nsenza nessun problema!</p>', 'Sabino Melillo', 'Sempre veloci e gentili', '1740449540.jpg', 1, 5, NULL, '2023-03-04 20:57:41'),
(2, 2, '<span style=\"color: rgb(0, 0, 0); font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Absolutely great service. I highly recommend it. They are very professional and helpful, I traveled in Rome for a few days. However, my boss in Canada asked me to sign, scan and send a document back to her ASAP. I desperately needed to find a printing shop at that time. </span>', '<p class=\"MsoNormal\"><span style=\"font-family:\"Arial\",\"sans-serif\"\">Servizio\r\nassolutamente fantastico. Lo consiglio vivamente. Sono molto professionali e\r\ndisponibili, ho viaggiato a Roma per qualche giorno. Tuttavia, il mio capo in\r\nCanada mi ha chiesto di firmare, scansionare e rispedirle un documento il prima\r\npossibile. Avevo un disperato bisogno di trovare una tipografia in quel\r\nmomento.<o:p></o:p></span></p>', 'Michel Wood', 'Professional and Fast Service', '711888362.jpg', 1, 5, NULL, '2023-03-04 21:05:16'),
(3, 3, '<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-ansi-language:EN-GB\">Professionalism, precision and attention to people,\r\nboth in big things and in small ones... \"Houston we have a problem\",\r\nstampamilano always finds a solution.<o:p></o:p></span></p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Professionalità,\r\nprecisione e attenzione alle persone, sia nelle grandi che nelle piccole...\r\n\"Houston abbiamo un problema\", stampa milano trova sempre una\r\nsoluzione.<o:p></o:p></span></p>', 'Angela Vacchi', 'Consigliati', '1289644371.jpg', 1, 5, NULL, '2023-03-04 20:55:47'),
(4, 4, '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">They are very professional, we shipped some documents in USA, only 2 dayes its reached in destination, no hassle, highly recommended</span><br></p>', '<p class=\"MsoNormal\">Sono molto professionali, abbiamo spedito alcuni documenti\r\nnegli Stati Uniti, solo 2 giorni è arrivato a destinazione, senza problemi,\r\naltamente raccomandato</p>', 'Malani Rivera', 'Quick and professional', '1266387063.jpg', 1, 5, NULL, '2023-03-04 21:04:34'),
(5, 5, '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; font-size: 13px; white-space: pre-wrap;\">Every thing worked perfectly. It was easy to find the driver. A very relaxing trip after a very long plane ride.</span><br></p>', '<p class=\"MsoNormal\">Ogni cosa ha funzionato perfettamente. È stato facile\r\ntrovare l\'autista. Un viaggio molto rilassante dopo un lungo viaggio in aereo.</p>', 'Dina Meyer', 'Avoid the hassle', '728031874.jpg', 1, 5, NULL, '2023-03-04 21:03:55');

